import React, { Component } from 'react';
import Home from './Home'
import Nav from './components/Nav'
import { Route, Switch } from 'react-router-dom'
import UploadPage from './components/UploadPage'
import './App.css'
import Axios from 'axios';

//USED FOR NAVIGATION COMP.
const profile = [
  "/Assets/Images/Mohan-muruge.jpg"
]

class App extends Component {
  render() {
    return (
      <div>
        <Nav profile={profile}/>
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/upload" component={UploadPage} />
          <Route path="/:id" render={(routeProps) => {
            console.log(routeProps.match.params.currentVidId)
            axios.get(mainVideoUrl(this.state.currentVidId))
            .then(response => {
              this.setState({
                currentVidImg: response.data.image,
                mainVideo: response.data,
                comments: response.data.comments
              })
            })
          }} />
        </Switch>
      </div>
    );
  }
}

export default App;
